function Contact() {
	return (
		<div className="contact-us">
			<h1 className='main'>Location:</h1>
			<p className="notmain"> Cocos Barbershop
			1234 Lincoln drive 
			Riverside Ca 92509
			</p>
			<h2 className='main'>Hours of Operation </h2>
			<p className='notmain'>Barber Services
				Monday - Friday 7am-6pm
			</p>
			<p className="notmain"> for more information please call 909-123-1234 Or send an email to info@cocosbarbershop.com</p>



		</div>
	);
}

export default Contact;
